export const recipes = [
    {
      id: 1,
      name: "Adobo",
      ingredients: ["chicken", "soy sauce", "vinegar", "garlic"],
      procedure: "1. Marinate chicken in soy sauce and vinegar.\n 2. Sauté garlic until fragrant.\n 3. Add marinated chicken and simmer until cooked.",
      image: "adobo.jpg"
    },
    {
        id: 2,
        name: "Chicken Inasal",
        ingredients: ["chicken", "ginger", "lemongrass", "garlic", "vinegar", "lemon or calamansi juice", "salt", "brown sugar", "lemon soda", "ground black pepper", "atsuete oil", "margarine"],
        procedure: "1. In a freezer bag or large bowl, combine 2 lbs chicken cut into serving pieces, lemongrass, salt, ½ tablespoon ground black pepper, 2 tablespoons ginger, 2 tablespoons garlic, ¼ cup of brown sugar, 1 cup vinegar, 1 cup lemon-lime soda, and ½ cup lemon juice.\n. 2. Stir or shake the mixture until every ingredient is well incorporated. Marinade for 1 to 3 hours.\n. 3. In a bowl, combine margarine, annatto oil, salt, and lemon juice then stir. Set aside.\n. 4. Grill the chicken while basting generous amounts of the margarine mixture.\n. 5. Transfer the grilled chicken to a serving plate.\n. 6. Serve with sinamak. Share and enjoy!",
        image: "chicken_inasal.jpg"
      },
      {
        id: 3,
        name: "Pancit Canton",
        ingredients: ["pancit canton noodles", "chicken", "soy sauce", "oyster sauce", "sesame oil", "carrots", "cabbage", "bell pepper", "snow peas", "garlic", "onion", "chicken broth", "cooking oil", "green onions"],
        procedure: "1. Cook pancit canton noodles according to package instructions. Set aside.\n2. In a wok or large pan, heat cooking oil.\n3. Sauté garlic and onions until aromatic.\n4. Add chicken strips and cook until browned.\n5. Push chicken to the side and sauté carrots, cabbage, bell pepper, and snow peas.\n6. Mix in soy sauce, oyster sauce, and sesame oil.\n7. Add cooked pancit canton noodles and chicken broth.\n8. Toss everything together until well combined.\n9. Garnish with green onions.\n10. Serve hot. Enjoy!",
        image: "pancit_canton.jpg"
      },
      {
        id: 4,
        name: "Lechon Kawali",
        ingredients: ["pork belly", "water", "salt", "pepper", "garlic powder", "cooking oil"],
        procedure: "1. Boil pork belly in water with salt and pepper until tender.\n2. Remove pork from the pot and let it cool.\n3. Rub garlic powder, salt, and pepper all over the pork belly.\n4. Heat oil in a deep pan.\n5. Deep fry pork until skin is crispy and golden.\n6. Slice and serve with liver sauce or vinegar dipping sauce.\n7. Enjoy your Lechon Kawali!",
        image: "lechon_kawali.jpg"
      },
      {
        id: 5,
        name: "Mango Float",
        ingredients: ["graham crackers", "ripe mangoes", "condensed milk", "all-purpose cream", "mango-flavored gelatin", "boiling water", "ice cubes"],
        procedure: "1. Dissolve mango-flavored gelatin in boiling water. Add ice cubes to set it faster.\n2. In a rectangular glass dish, arrange graham crackers at the bottom.\n3. Spread a layer of condensed milk and all-purpose cream mixture over the graham crackers.\n4. Add a layer of sliced ripe mangoes.\n5. Pour a layer of the gelatin mixture.\n6. Repeat the layers until you reach the top.\n7. Chill in the refrigerator for a few hours or overnight.\n8. Slice and serve cold. Enjoy your Mango Float!",
        image: "mango_float.jpg"
      },
      {
        id: 6,
        name: "Bibimbap",
        ingredients: ["steamed rice", "carrots", "zucchini", "spinach", "bean sprouts", "shiitake mushrooms", "ground beef", "soy sauce", "sesame oil", "sugar", "garlic", "fried eggs", "gochujang (Korean red pepper paste)"],
        procedure: "1. Cook steamed rice and set aside.\n2. Julienne carrots and zucchini. Blanch in boiling water until slightly tender.\n3. Blanch spinach and bean sprouts separately. Squeeze out excess water.\n4. Sauté shiitake mushrooms until cooked.\n5. In a pan, cook ground beef with soy sauce, sesame oil, sugar, and minced garlic.\n6. Fry eggs sunny-side-up.\n7. Assemble bibimbap: Place rice in a bowl, arrange vegetables and beef on top, and add a fried egg.\n8. Serve with gochujang on the side.\n9. Mix before eating. Enjoy your Bibimbap!",
        image: "bibimbap.jpg"
      },
      {
        id: 7,
        name: "Taho",
        ingredients: ["soft tofu", "arnibal (sweet syrup)", "sago pearls (tapioca pearls)"],
        procedure: "1. Boil sago pearls until cooked. Set aside.\n2. Cut soft tofu into small cubes.\n3. In a glass, layer soft tofu, cooked sago pearls, and arnibal.\n4. Repeat layers until the glass is filled.\n5. Serve warm. Enjoy your homemade Taho!",
        image: "taho.jpg"
      },
      {
        id: 8,
        name: "Tapsilog",
        ingredients: ["beef sirloin", "soy sauce", "calamansi juice", "garlic", "sugar", "salt", "pepper", "cooking oil", "fried rice", "fried eggs", "atchara (pickled papaya)"],
        procedure: "1. Marinate beef sirloin in soy sauce, calamansi juice, minced garlic, sugar, salt, and pepper. Let it sit for at least 30 minutes.\n2. In a pan, heat cooking oil and pan-fry marinated beef until cooked.\n3. Serve beef with fried rice, fried eggs, and atchara on the side.\n4. Enjoy your Tapsilog!",
        image: "tapsilog.jpg"
      },
      {
        id: 9,
        name: "Crispy Pata",
        ingredients: ["pig leg", "dried bay leaves", "peppercorn", "star anise", "salt", "garlic powder", "brown sugar", "water", "cooking oil"],
        procedure: "1. Pour 12 cups of water in a cooking pot then let boil.\n2. Put 6 dried bay leaves, 2 tbsp of whole peppercorn, 4 pcs of star anise, and 4 tsp of salt.\n3. Add the whole pig’s legs in the cooking pot then simmer until the leg becomes tender (about 45 to 60 minutes).\n4. Remove the tender leg from the cooking pot and set aside until the temperature goes down.\n5. Rub the leg with 2 teaspoons of garlic powder, 2 teaspoons of ground black pepper, and remaining salt. Let stand for 15 minutes to absorb the rub.\n6. Heat a clean large cooking pot (preferably with a cover) and pour-in cooking oil.\n7. When the oil becomes hot, deep fry the rubbed pork leg. Continue cooking in medium heat until one side becomes crispy, and then cautiously flip the leg to crisp the other side.\n8. Turn off the heat; remove the crispy pork leg; and transfer it to a wide serving plate.\n9. Serve with atcharang papaya and soy sauce – vinegar dipping sauce.\n10. Share and enjoy!",
        image: "crispy_pata.jpg"
      },
      {
        id: 10,
        name: "Sinigang",
        ingredients: ["pork belly or buto-buto", "spinach or kangkong", "fish sauce", "string beans", "tomato", "chili pepper", "cooking oil", "water", "onion", "gabi", "sinigang mix"],
        procedure: "1. Heat the pot and put-in the cooking oil.\n2. Sauté the onion until its layers separate from each other.\n3. Add the 2 lbs chopped pork belly and cook until the outer part turns light brown.\n4. Put-in the 3 tbsp fish sauce and mix with the ingredients.\n5. Pour the 2 quarts of water and bring to a boil.\n6. Add the 2 pcs quartered taro/gabi and 2 pcs quartered tomatoes then simmer for 40 minutes or until the pork is tender.\n7. Put-in the 1 pack sinigang mix and chili.\n8. Add the 1 bundle of sliced string beans (and other vegetables if there are any) and simmer for 5 to 8 minutes.\n9. Put-in 1 bunch spinach, turn off the heat, and cover the pot. Let the spinach cook using the remaining heat in the pot.\n10. Serve hot. Share and enjoy!",
        image: "sinigang.jpg"
      },
      {
        id: 11,
        name: "Pancit Palabok",
        ingredients: ["bihon", "ground pork", "anatto seeds", "pork shoulder", "shrimp bouillon", "beef broth", "all-purpose flour", "fish sauce", "ground black pepper", "pork belly", "tinapa flakes", "chicharon", "hard-boiled egg", "cabbage",  "shrimp cubes",  "green onion", "garlic", "lemon", "cooking oil", "salt", "pepper", "water"],
        procedure: "1. Soak the noodles in water until it gets soft. Drain the water.\n2. Boil 6 cups of water in a cooking pot. Once the water boils, quickly submerge 1 pack of noodles in it and cook for 1 to 3 minutes. Drain the water right away. Set the noodles aside.\n3. Heat the oil 3 tablespoons in a cooking pot.\n4. Once the oil gets hot, quickly pan-fry the 10 piece shrimp for around 30 seconds per side. Remove the shrimp and set aside.\n5. Put-in the ground pork and pork belly. Saute until the color turns light brown.\n6. Pour-in 4 cups beef broth and add 1 piece shrimp cube. Let boil. Cover and simmer until the pork gets tender.\n7. Add 6 cups of water from the soaked annatto seeds. Stir.\n8. Add 6 1/2 flour diluted in water. Stir the mixture and ensure that all ingredients are distributed properly. (Note: this means that the flour and water are combined and stirred thoroughly until well blended.) Continue to cook in low to medium heat until the sauce thickens.\n9. Add 2 tablespoons tilapia flakes and some salt and pepper to taste. Stir and set aside.\n10. Now that the sauce is ready, you can start to assemble your simple pancit palabok. Arrange the noodles on a serving plate, pour the sauce over the noodles. Gently toss the noodles so that it gets coated with sauce. Top with Napa cabbage, scallions, pork rinds, shrimp, more tilapia flakes, and egg.\n11. Serve with a slice of lemon or calamansi. Share and enjoy!",
        image: "pancit_palabok.jpg"
      },
      
  ];
